# ^ these can be updated via https://github.com/justanotherfoundry/font-production/tree/master/import%20CLDR

existing_characters = set()
for glyph in Glyphs.font.glyphs:
	if glyph.string:
		existing_characters.add(glyph.string)
supported_languages = []
unsupported = []
required_characters = set()
for language, required in required_characters_fontbook.items():
	if languages_population.get(language, 0) < MINIMUM_POPULATION:
		continue
	required = set(required)
	if required.issubset(existing_characters):
		supported_languages.append(language_names[language])
		required_characters.update(required)
	else:
		missing = required - existing_characters
		if len(missing) <= MAXIMUM_MISSING_CHARS and len(missing) > 0:
			unsupported.append((languages_population[language], language_names[language], ''.join(missing)))
unsupported.sort(reverse = True)
for popu, name, missing in unsupported:
	print('(', '{0:11,}'.format(popu), 'speakers) missing from', (name + ':').ljust(14), missing)
supported_languages.sort()
superfluous_characters = list(existing_characters - required_characters)
superfluous_characters.sort()
superfluous_characters = [s for s in superfluous_characters if s.isalpha()]
print()
print('supported:')
print(', '.join(supported_languages))
print()
print('required in supported languages:')
print(''.join(required_characters))
print()
print('not required in any supported language:')
print(''.join(superfluous_characters))

